def reset_ticks(self):
    """
    Re-initialize the major and minor Tick lists.

    Each list starts with a single fresh Tick.
    """
    try:
        del self.majorTicks
    except AttributeError:
        pass
    try:
        del self.minorTicks
    except AttributeError:
        pass
    try:
        self.set_clip_path(self.axes.patch)
    except AttributeError:
        pass

def set_tick_params(self, which='major', reset=False, **kw):
    """
    Set appearance parameters for ticks, ticklabels, and gridlines.

    For documentation of keyword arguments, see
    :meth:`matplotlib.axes.Axes.tick_params`.
    """
    dicts = []
    if which == 'major' or which == 'both':
        dicts.append(self._major_tick_kw)
    if which == 'minor' or which == 'both':
        dicts.append(self._minor_tick_kw)
    kwtrans = self._translate_tick_kw(kw)
    for d in dicts:
        if reset:
            d.clear()
        d.update(kwtrans)
    if reset:
        self.reset_ticks()
    else:
        if which == 'major' or which == 'both':
            for tick in self.majorTicks:
                tick._apply_params(**kwtrans)
        if which == 'minor' or which == 'both':
            for tick in self.minorTicks:
                tick._apply_params(**kwtrans)
        if 'labelcolor' in kwtrans:
            self.offsetText.set_color(kwtrans['labelcolor'])
    self.stale = True

@staticmethod
def _translate_tick_kw(kw):
    kwkeys = ['size', 'width', 'color', 'tickdir', 'pad', 'labelsize', 'labelcolor', 'zorder', 'gridOn', 'tick1On', 'tick2On', 'label1On', 'label2On', 'length', 'direction', 'left', 'bottom', 'right', 'top', 'labelleft', 'labelbottom', 'labelright', 'labeltop', 'labelrotation'] + _gridline_param_names
    kwtrans = {}
    if 'length' in kw:
        kwtrans['size'] = kw.pop('length')
    if 'direction' in kw:
        kwtrans['tickdir'] = kw.pop('direction')
    if 'rotation' in kw:
        kwtrans['labelrotation'] = kw.pop('rotation')
    if 'left' in kw:
        kwtrans['tick1On'] = kw.pop('left')
    if 'bottom' in kw:
        kwtrans['tick1On'] = kw.pop('bottom')
    if 'right' in kw:
        kwtrans['tick2On'] = kw.pop('right')
    if 'top' in kw:
        kwtrans['tick2On'] = kw.pop('top')
    if 'labelleft' in kw:
        kwtrans['label1On'] = kw.pop('labelleft')
    if 'labelbottom' in kw:
        kwtrans['label1On'] = kw.pop('labelbottom')
    if 'labelright' in kw:
        kwtrans['label2On'] = kw.pop('labelright')
    if 'labeltop' in kw:
        kwtrans['label2On'] = kw.pop('labeltop')
    if 'colors' in kw:
        c = kw.pop('colors')
        kwtrans['color'] = c
        kwtrans['labelcolor'] = c
    for key in kw:
        if key not in kwkeys:
            raise ValueError('keyword %s is not recognized; valid keywords are %s' % (key, kwkeys))
        kwtrans.update(kw)
    return kwtrans

def set_clip_path(self, clippath, transform=None):
    martist.Artist.set_clip_path(self, clippath, transform)
    for child in self.majorTicks + self.minorTicks:
        child.set_clip_path(clippath, transform)
    self.stale = True

