def get_ticklabel_extents(self, renderer):
    """
    Get the extents of the tick labels on either side
    of the axes.
    """
    ticks_to_draw = self._update_ticks()
    ticklabelBoxes, ticklabelBoxes2 = self._get_tick_bboxes(ticks_to_draw, renderer)
    if len(ticklabelBoxes):
        bbox = mtransforms.Bbox.union(ticklabelBoxes)
    else:
        bbox = mtransforms.Bbox.from_extents(0, 0, 0, 0)
    if len(ticklabelBoxes2):
        bbox2 = mtransforms.Bbox.union(ticklabelBoxes2)
    else:
        bbox2 = mtransforms.Bbox.from_extents(0, 0, 0, 0)
    return (bbox, bbox2)

def get_smart_bounds(self):
    """Return whether the axis has smart bounds."""
    return self._smart_bounds

def _update_ticks(self):
    """
    Update ticks (position and labels) using the current data interval of
    the axes.  Return the list of ticks that will be drawn.
    """
    major_locs = self.get_majorticklocs()
    major_labels = self.major.formatter.format_ticks(major_locs)
    major_ticks = self.get_major_ticks(len(major_locs))
    self.major.formatter.set_locs(major_locs)
    for tick, loc, label in zip(major_ticks, major_locs, major_labels):
        tick.update_position(loc)
        tick.set_label1(label)
        tick.set_label2(label)
    minor_locs = self.get_minorticklocs()
    minor_labels = self.minor.formatter.format_ticks(minor_locs)
    minor_ticks = self.get_minor_ticks(len(minor_locs))
    self.minor.formatter.set_locs(minor_locs)
    for tick, loc, label in zip(minor_ticks, minor_locs, minor_labels):
        tick.update_position(loc)
        tick.set_label1(label)
        tick.set_label2(label)
    ticks = [*major_ticks, *minor_ticks]
    view_low, view_high = self.get_view_interval()
    if view_low > view_high:
        view_low, view_high = (view_high, view_low)
    if self._smart_bounds and ticks:
        data_low, data_high = sorted(self.get_data_interval())
        locs = np.sort([tick.get_loc() for tick in ticks])
        if data_low <= view_low:
            ilow = view_low
        else:
            good_locs = locs[locs <= data_low]
            if len(good_locs):
                ilow = good_locs[-1]
            else:
                ilow = locs[0]
        if data_high >= view_high:
            ihigh = view_high
        else:
            good_locs = locs[locs >= data_high]
            if len(good_locs):
                ihigh = good_locs[0]
            else:
                ihigh = locs[-1]
        ticks = [tick for tick in ticks if ilow <= tick.get_loc() <= ihigh]
    interval_t = self.get_transform().transform([view_low, view_high])
    ticks_to_draw = []
    for tick in ticks:
        try:
            loc_t = self.get_transform().transform(tick.get_loc())
        except AssertionError:
            pass
        else:
            if mtransforms._interval_contains_close(interval_t, loc_t):
                ticks_to_draw.append(tick)
    return ticks_to_draw

def _get_tick_bboxes(self, ticks, renderer):
    """Return lists of bboxes for ticks' label1's and label2's."""
    return ([tick.label1.get_window_extent(renderer) for tick in ticks if tick.label1.get_visible()], [tick.label2.get_window_extent(renderer) for tick in ticks if tick.label2.get_visible()])

def get_tick_padding(self):
    values = []
    if len(self.majorTicks):
        values.append(self.majorTicks[0].get_tick_padding())
    if len(self.minorTicks):
        values.append(self.minorTicks[0].get_tick_padding())
    return max(values, default=0)

