def get_major_ticks(self, numticks=None):
    """Get the tick instances; grow as necessary."""
    if numticks is None:
        numticks = len(self.get_majorticklocs())
    while len(self.majorTicks) < numticks:
        tick = self._get_tick(major=True)
        self.majorTicks.append(tick)
        tick.gridline.set_visible(self._gridOnMajor)
        self._copy_tick_props(self.majorTicks[0], tick)
    return self.majorTicks[:numticks]

def get_minor_ticks(self, numticks=None):
    """Get the minor tick instances; grow as necessary."""
    if numticks is None:
        numticks = len(self.get_minorticklocs())
    while len(self.minorTicks) < numticks:
        tick = self._get_tick(major=False)
        self.minorTicks.append(tick)
        tick.gridline.set_visible(self._gridOnMinor)
        self._copy_tick_props(self.minorTicks[0], tick)
    return self.minorTicks[:numticks]

def grid(self, b=None, which='major', **kwargs):
    """
    Configure the grid lines.

    Parameters
    ----------
    b : bool or None
        Whether to show the grid lines. If any *kwargs* are supplied,
        it is assumed you want the grid on and *b* will be set to True.

        If *b* is *None* and there are no *kwargs*, this toggles the
        visibility of the lines.

    which : {'major', 'minor', 'both'}
        The grid lines to apply the changes on.

    **kwargs : `.Line2D` properties
        Define the line properties of the grid, e.g.::

            grid(color='r', linestyle='-', linewidth=2)

    """
    if len(kwargs):
        if not b and b is not None:
            cbook._warn_external('First parameter to grid() is false, but line properties are supplied. The grid will be enabled.')
        b = True
    which = which.lower()
    cbook._check_in_list(['major', 'minor', 'both'], which=which)
    gridkw = {'grid_' + item[0]: item[1] for item in kwargs.items()}
    if which in ['minor', 'both']:
        if b is None:
            self._gridOnMinor = not self._gridOnMinor
        else:
            self._gridOnMinor = b
        self.set_tick_params(which='minor', gridOn=self._gridOnMinor, **gridkw)
    if which in ['major', 'both']:
        if b is None:
            self._gridOnMajor = not self._gridOnMajor
        else:
            self._gridOnMajor = b
        self.set_tick_params(which='major', gridOn=self._gridOnMajor, **gridkw)
    self.stale = True

def _update_axisinfo(self):
    """
    check the axis converter for the stored units to see if the
    axis info needs to be updated
    """
    if self.converter is None:
        return
    info = self.converter.axisinfo(self.units, self)
    if info is None:
        return
    if info.majloc is not None and self.major.locator != info.majloc and self.isDefault_majloc:
        self.set_major_locator(info.majloc)
        self.isDefault_majloc = True
    if info.minloc is not None and self.minor.locator != info.minloc and self.isDefault_minloc:
        self.set_minor_locator(info.minloc)
        self.isDefault_minloc = True
    if info.majfmt is not None and self.major.formatter != info.majfmt and self.isDefault_majfmt:
        self.set_major_formatter(info.majfmt)
        self.isDefault_majfmt = True
    if info.minfmt is not None and self.minor.formatter != info.minfmt and self.isDefault_minfmt:
        self.set_minor_formatter(info.minfmt)
        self.isDefault_minfmt = True
    if info.label is not None and self.isDefault_label:
        self.set_label_text(info.label)
        self.isDefault_label = True
    self.set_default_intervals()

def convert_units(self, x):
    if munits.ConversionInterface.is_numlike(x):
        return x
    if self.converter is None:
        self.converter = munits.registry.get_converter(x)
    if self.converter is None:
        return x
    try:
        ret = self.converter.convert(x, self.units, self)
    except Exception as e:
        raise munits.ConversionError(f'Failed to convert value(s) to axis units: {x!r}') from e
    return ret

def get_units(self):
    """Return the units for axis."""
    return self.units

def set_ticks(self, ticks, minor=False):
    """
    Set the locations of the tick marks from sequence ticks

    Parameters
    ----------
    ticks : sequence of floats
    minor : bool
    """
    ticks = self.convert_units(ticks)
    if len(ticks) > 1:
        xleft, xright = self.get_view_interval()
        if xright > xleft:
            self.set_view_interval(min(ticks), max(ticks))
        else:
            self.set_view_interval(max(ticks), min(ticks))
    if minor:
        self.set_minor_locator(mticker.FixedLocator(ticks))
        return self.get_minor_ticks(len(ticks))
    else:
        self.set_major_locator(mticker.FixedLocator(ticks))
        return self.get_major_ticks(len(ticks))

def pan(self, numsteps):
    """Pan *numsteps* (can be positive or negative)"""
    self.major.locator.pan(numsteps)

def zoom(self, direction):
    """Zoom in/out on axis; if *direction* is >0 zoom in, else zoom out"""
    self.major.locator.zoom(direction)

def _get_ticks_position(self):
    """
    Helper for `XAxis.get_ticks_position` and `YAxis.get_ticks_position`.

    Check the visibility of tick1line, label1, tick2line, and label2 on
    the first major and the first minor ticks, and return

    - 1 if only tick1line and label1 are visible (which corresponds to
      "bottom" for the x-axis and "left" for the y-axis);
    - 2 if only tick2line and label2 are visible (which corresponds to
      "top" for the x-axis and "right" for the y-axis);
    - "default" if only tick1line, tick2line and label1 are visible;
    - "unknown" otherwise.
    """
    major = self.majorTicks[0]
    minor = self.minorTicks[0]
    if all((tick.tick1line.get_visible() and (not tick.tick2line.get_visible()) and tick.label1.get_visible() and (not tick.label2.get_visible()) for tick in [major, minor])):
        return 1
    elif all((tick.tick2line.get_visible() and (not tick.tick1line.get_visible()) and tick.label2.get_visible() and (not tick.label1.get_visible()) for tick in [major, minor])):
        return 2
    elif all((tick.tick1line.get_visible() and tick.tick2line.get_visible() and tick.label1.get_visible() and (not tick.label2.get_visible()) for tick in [major, minor])):
        return 'default'
    else:
        return 'unknown'

