def get_text_heights(self, renderer):
    """
    Returns the amount of space one should reserve for text
    above and below the axes.  Returns a tuple (above, below)
    """
    bbox, bbox2 = self.get_ticklabel_extents(renderer)
    padPixels = self.majorTicks[0].get_pad_pixels()
    above = 0.0
    if bbox2.height:
        above += bbox2.height + padPixels
    below = 0.0
    if bbox.height:
        below += bbox.height + padPixels
    if self.get_label_position() == 'top':
        above += self.label.get_window_extent(renderer).height + padPixels
    else:
        below += self.label.get_window_extent(renderer).height + padPixels
    return (above, below)

def set_ticks_position(self, position):
    """
    Set the ticks position (top, bottom, both, default or none)
    both sets the ticks to appear on both positions, but does not
    change the tick labels.  'default' resets the tick positions to
    the default: ticks on both positions, labels at bottom.  'none'
    can be used if you don't want any ticks. 'none' and 'both'
    affect only the ticks, not the labels.

    Parameters
    ----------
    position : {'top', 'bottom', 'both', 'default', 'none'}
    """
    if position == 'top':
        self.set_tick_params(which='both', top=True, labeltop=True, bottom=False, labelbottom=False)
    elif position == 'bottom':
        self.set_tick_params(which='both', top=False, labeltop=False, bottom=True, labelbottom=True)
    elif position == 'both':
        self.set_tick_params(which='both', top=True, bottom=True)
    elif position == 'none':
        self.set_tick_params(which='both', top=False, bottom=False)
    elif position == 'default':
        self.set_tick_params(which='both', top=True, labeltop=False, bottom=True, labelbottom=True)
    else:
        raise ValueError('invalid position: %s' % position)
    self.stale = True

